// Handles the XML generated event.
function onXmlGenerated() {
    var rows = dom.getElementsByTagName("row");
    if (rows.getLength() > 0) {
    	var row = rows.item(0);
    	var password = "" + row.getAttribute("password");
    	log.message("password=" + password);
    	password = "" + context.decodeFromHexString(cipheringKey, password);
    	row.setAttribute("password", password);
    }
}

